        assert codepoint == ord('·Äû')
        codepoint = tokenizer.advance()
        assert codepoint == ord('·Äî')
        codepoint = tokenizer.advance()
        assert codepoint == ord('ÂΩ°')
        codepoint = tokenizer.advance()
        assert codepoint == ord('x')
        codepoint = tokenizer.advance()
        assert codepoint == ord('y')
        codepoint = tokenizer.advance()
        assert codepoint == ord('z')
        codepoint = tokenizer.advance()
        assert codepoint == ord('‰Ω†')
        codepoint = tokenizer.advance()
        assert codepoint == ord('Âè´')
        codepoint = tokenizer.advance()
        assert codepoint == ord('‰ªÄ')
        codepoint = tokenizer.advance()
        assert codepoint == ord('‰πà')
        codepoint = tokenizer.advance()
        assert codepoint == ord('Âêç')
        codepoint = tokenizer.advance()
        assert codepoint == ord('Â≠ó')
        codepoint = tokenizer.advance()
        assert codepoint == ord('–Ø')
        codepoint = tokenizer.advance()
        assert codepoint == Text.eos_codepoint()

